import React from 'react';
import './ContactUs.css';

const ContactUs = () => {
  return (
    <div className="contact-us">
      <h1>Contact Us</h1>
      <p>If you have any questions or need assistance, feel free to contact us.</p>
      {/* Add form or contact details */}
    </div>
  );
};

export default ContactUs;
